import {drgns} from './Body';

// Filter by Trainable
export const TFilter = (op) => {
    return drgns.filter(drgn => {
        return drgn.trainable === true ? op === 'Yes' : drgn.trainable === false;
    })
}

const filtertDrgns = (op) => {
    const trainableFiltered = drgns.filter(drgn => {
        return drgn.trainable === true ? op === 'Yes' : drgn.trainable === false;
    });
}
